// Random string generator. The code below is a function you can use.

String.RandomString = function(length, minCodepoint = 0, maxCodepoint = 255){
    var str = "";
    for(i = 0; i < length; i++){
        str += String.fromCharCode(Math.round(Math.random() * (maxCodepoint - minCodepoint)) + minCodepoint);
    }
    return str;
}

// Use it like this: String.RandomString([your desired length], ?[minimal code point], ?[maximal code point])
// ? - optional

